import React from 'react';

const StartPage = ({onNavigate, onSelectSkill}) => {
    const handleTileClick = (skill) => {
        onNavigate('home');
        onSelectSkill(skill);
    };

    const skills = [
        { name: 'Active Listening', icon: 'üëÇ' , scenarios: ['1', '2', '3']},
        { name: 'Ambiguity Tolerance', icon: '‚ùì', scenarios: ['1', '2'] },
        { name: 'Conflict Avoidance', icon: '‚ÜîÔ∏è', scenarios: ['1', '2'] },
        { name: 'Conflict Resolution', icon: 'üéØ', scenarios: ['1', '2', '3'] },
        { name: 'Empathy', icon: '‚ù§Ô∏è', scenarios: ['1', '2', '3'] },
        { name: 'Cultural Competence', icon: 'üë•', scenarios: ['1', '2'] },
        { name: 'Advising and Instruction', icon: 'üë®‚Äçüè´', scenarios: ['1', '2', '3'] },
        { name: 'Paraphrasing', icon: 'üîÑ', scenarios: ['1', '2']},
        { name: 'Negotiation', icon: 'ü§ù', scenarios: ['1', '2', '3']},
        { name: 'Debate', icon: 'üó£Ô∏è', scenarios: ['1']},
        { name: 'Behavioral Counseling', icon: 'üß†', scenarios: ['1', '2', '3', '4']},
        { name: 'Assertive Communication', icon: 'üó£Ô∏è', scenarios: ['1', '2']},
      ];

    return (
    <div className="root">
      <div className="title">Social Sprout!</div>
      <div className="subtitle">
        Select a social skill to learn more about it and train your abilities!
      </div>
      <div className="grid-container">
        {skills.map((skill) => (
          <div
            key={skill.name}
            className="tile"
            onClick={() => handleTileClick(skill.name)}
          >
            <div className="icon">{skill.icon}</div>
            <div>{skill.name}</div>
          </div>
        ))}
      </div>
    </div>
  );

}

export default StartPage;
